import { Grid, Paper } from '@mui/material';
import React, { useEffect, useState } from 'react'

export default function Notes() {
  const [notes, setNotes] = useState([]);

  useEffect(() => {
    fetch('http://localhost:8000/notes')
      .then(res => res.json())
      .then(data => setNotes(data))
  }, [])

  return (
    <div>
      <Grid container>
        <Grid item>
          <Paper>1</Paper>
        </Grid>
        <Grid item>
          <Paper>2</Paper>
        </Grid>
        <Grid item>
          <Paper>3</Paper>
        </Grid>
        <Grid item>
          <Paper>4</Paper>
        </Grid>
      </Grid>
      {notes.map(note => (
        <p key={note.id}> title: { note.title }</p>
      ))}
    </div>
  )
}
